import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import dataCar from "./carsData/carsData.json";



export class Audi extends Component {
    render() {


        return (


            <div className="container mt-5">

                <h1 className="mb-5">Latest Added Cars :</h1>
                {dataCar.map(cdata => (
                    <Link key={cdata.id} to={"/car" + "/" + cdata.id} className="row cars-sel mb-1" style={{ textDecoration: 'none' }}>
                        <img src={cdata.img} alt={cdata.name} style={{ borderBottomLeftRadius: '8px' , borderTopLeftRadius: '8px'}} className="col-lg-3" />
                        <div className="col-lg-9">
                            <h3>{cdata.name}</h3>
                            <p>{cdata.price}</p>
                            <p>{cdata.Reviews}</p>
                        </div>
                    </Link>
                ))}
            </div>
        )
    }
}

export default Audi
